import React, { useState } from 'react';
import axios from 'axios';

function Home() {
  const [showLoginForm, setShowLoginForm] = useState(false);
  const [showRegisterForm, setShowRegisterForm] = useState(false);

  const handleLoginClick = () => {
    setShowLoginForm(true);
  };

  const handleRegisterClick = () => {
    setShowRegisterForm(true);
  };

  return (
    <div className="home">
      <header id="header">
        <div className="intro">
          <div className="overlay">
            <div className="container">
              <div className="row">
                <div className="col-md-8 col-md-offset-2 intro-text">
                  <h1>Houses & Appartments<br></br>
                  For Rentals</h1>
                  <h2>Find your dream home here...!!</h2>
                  <li className='login-btn'>
                    <button onClick={handleLoginClick}>Login</button>
                  </li>
                </div>
              </div>
            </div>
          </div>
        </div>
      </header>
      {showLoginForm && (
        <LoginForm
          onRegisterClick={handleRegisterClick}
          onClose={() => setShowLoginForm(false)}
        />
      )}
      {showRegisterForm && (
        <RegisterForm
          onLoginClick={handleLoginClick}
          onClose={() => setShowRegisterForm(false)}
        />
      )}
    </div>
  );
}

function LoginForm({ onRegisterClick, onClose }) {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState(null);

  const handleSubmit = (event) => {
    event.preventDefault();
    // Call API to authenticate user
    axios.post('/api/authenticate', { username, password })
      .then(response => {
        // Handle successful login
        console.log(response);
      })
      .catch(error => {
        setError(error.message);
      });
  };

  return (
    <div className="login-form">
      <h2>Login</h2>
      <form onSubmit={handleSubmit}>
        <label>Username:</label>
        <input type="text" value={username} onChange={(event) => setUsername(event.target.value)} />
        <br />
        <label>Password:</label>
        <input type="password" value={password} onChange={(event) => setPassword(event.target.value)} />
        <br />
        {error && <div style={{ color: 'red' }}>{error}</div>}
        <button type="submit">Login</button>
        <p>Don't have an account? <a href="#" onClick={onRegisterClick}>Register</a></p>
      </form>
      <button onClick={onClose}>Close</button>
    </div>
  );
}

function RegisterForm({ onLoginClick, onClose }) {
  const [username, setUsername] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const [error, setError] = useState(null);

  const handleSubmit = (event) => {
    event.preventDefault();
    // Call API to create new user
    axios.post('/api/register', { username, email, password, confirmPassword })
      .then(response => {
        // Handle successful registration
        console.log(response);
      })
      .catch(error => {
        setError(error.message);
      });
  };

  return (
    <div className="register-form">
      <h2>Register</h2>
      <form onSubmit={handleSubmit}>
        <label>Username:</label>
        <input type="text" value={username} onChange={(event) => setUsername(event.target.value)} />
        <br />
        <label>Email:</label>
        <input type="email" value={email} onChange={(event) => setEmail(event.target.value)} />
        <br />
        <label>Password:</label>
        <input type="password" value={password} onChange={(event) => setPassword(event.target.value)} />
        <br />
        <label>Confirm Password:</label>
        <input type="password" value={confirmPassword} onChange={(event) => setConfirmPassword(event.target.value)} />
        <br />
        {error && <div style={{ color: 'red' }}>{error}</div>}
        <button type="submit">Register</button>
        <p>Already have an account? <a href="#" onClick={onLoginClick}>Login</a></p>
      </form>
      <button onClick={onClose}>Close</button>
    </div>
  );
}

export default Home;
